INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (6, 3, 'Sem Assunto', 'Estou procurando bermuda masculina Com bolsos laterais 100 por cento poliéster.', 'Customer', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-13 03:08:42');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (7, 3, 'RE: Sem Assunto', 'Olá! Tudo bem? Não temos esse modelo :/ Temos outros modelos no site, dá uma olhada.', 'Expert', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-13 03:08:42');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (8, 3, 'RE: Sem Assunto', 'Obrigado. GOsto de bermuda com bolsos laterais . Quem fabricou este modelo?', 'Customer', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-13 03:08:42');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (9, 4, 'Reclamação', 'Boa noite! Comprei na loja um tênis para minha filha, porém está manchando a meia, vejam as fotos; O que fazer para não estragar todas as meias???', 'Customer', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-25 03:12:39');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (10, 4, 'RE: Reclamação', 'Bom dia Tudo bem? Esperamos que sim! Poxa, uma pena ter ocorrido com o tênis... Neste caso, há uma garantia diferenciada de 12 meses, e para oferecer essa garantia, a marca define que para casos de defeitos, seja feito a avaliação diretamente com eles, para avaliar o defeito e já emitir o código de autorização da troca. Assim que emitido o código, basta comparecer até a loja com o produto para trocar!', 'Expert', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-25 03:12:39');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (11, 5, 'Tamanho diferente', 'Boa tarde ! Comprei um tênis tamanho 38 na loja. Entretanto, o pé direito está maior do que o pé esquerdo e só notei ao usá-lo. Essa diferença está notável externamente. Aguardo uma solução', 'Customer', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-21 03:51:39');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (12, 5, 'RE: Tamanho diferente', 'Boa tarde. Tudo bem? Esperamos que sim! No caso, basta comparecer a loja onde foi efetuado a compra para verificar as possibilidades de troca/solução referente ao defeito do seu produto, com o produto e nota fiscal em mãos.', 'Expert', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-21 03:51:39');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (13, 6, 'Sem assunto', 'Boa tarde ,efetuei uma compra e digitei o meu email errado e nao consigo acompanhar a entrega e a compra o que faço', 'Customer', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-09 01:34:49');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (14, 6, 'RE: Dúvidas', 'Boa noite. Por favor, me informa o número do CPF cadastrado ou número do pedido?', 'Expert', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-09 01:34:49');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (15, 6, 'RE: Dúvidas', 'Boa tarde segue o numero do pedido 12345', 'Customer', '2020-11-09 18:16:48', '2020-11-09 18:16:48', '2017-12-09 01:34:49');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (16, 7, 'Reclamação', 'efetuei a compra de um produto e até agora nao foi entregue a mercadoria, no site de vcs nao consta o pedido como pendente, já veio debitada a compra na fatura do meu cartão, ja tentei de várias formas e não consigo soluçao, gostaria de resolver da melhor maneira possivel direto com a loja antes de tomar as providências cabíveis', 'Customer', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-22 01:05:19');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (17, 7, 'RE: Reclamação', 'Bom dia. Infelizmente a entrega retornou e não conseguimos entrar em contato. Seus dados estão corretos?', 'Expert', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-22 01:05:19');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (18, 8, 'Entrega', 'Bom dia, O prazo de entrega do produto foi ontem e até o momento não recebemos o pedido, confirmado o pagamento. Por gentileza, verificar o ocorrido uma vez que já trocamos o produto', 'Customer', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-16 11:41:52');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (19, 8, 'RE: Entrega', 'Bom dia. Por favor, qual o número do pedido para que eu possa verificar seu andamento?', 'Expert', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-16 11:41:52');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (20, 9, 'Elogios', 'Muito obrigado pela gentileza e atenção.Vocês sao simpaticos, gentis e agradaveis de se lidar e de respeito ao consumidor.Não tenho mais palavras para agradecer tamanha gentileza e simpatia.Fiquei muito satisfeito.Recomendarei a todos.', 'Customer', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-07 02:40:42');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (21, 9, 'RE: Elogios', 'Que ótimo que tenha gostado. Sem palavras, receber um agradecimento por excelência é sensacional para nós.', 'Expert', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-07 02:40:42');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (22, 10, 'Elogios e Sugestões', 'Ficou otimo. Sensacional, gostei.Mais uma vez, elogios para vocês. Obrigado pela atenção, boas vendas.', 'Customer', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-12 01:24:14');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (23, 10, 'RE: Elogios e Sugestões', 'Muito bom saber. Nossa satisfação aumenta com clientes assim.', 'Expert', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-12 01:24:14');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (24, 11, 'Elogios', 'Parabens pelo produto de voces, pelo bom atendimento e rapidez na entrega. Voces sao otimos.', 'Customer', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-03 12:44:34');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (25, 11, 'RE: Elogios', 'Ficamos felizes em saber que nosso trabalho traz momentos especiais.', 'Expert', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-03 12:44:34');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (26, 12, 'Dúvida', 'Olá eu queria saber se tem data pra ter ou se já está disponivel o produto ABC em alguma loja física', 'Customer', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-18 06:24:45');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (27, 12, 'RE: Dúvida', 'Não há previsão de reposição desse produto, mas qual modelo está procurando?', 'Expert', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-18 06:24:45');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (28, 13, 'Planos e Formas de Pagamento', 'A 1º parcela de 72,00 refere-se a 3 meses de plano, mas o que significa que a assinatura será renovada automaticamente com o valor de 29,00 ? Este procedimento é depois dos 3 meses, ou terei que pagar', 'Customer', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-03 04:57:38');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (29, 13, 'RE: Planos e Formas de Pagamento', 'Olá. O valor de R$72,00 refere-se apenas aos 3 primeiros meses. As próximas renovações após os 3 meses terão o valor de R$29,00. Caso haja mais dúvidas, por favor entrar em contato.', 'Expert', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-03 04:57:38');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (30, 14, 'COnfirmação de data de entrega', 'Gostaria da confirmaço da data para entrega. Tres dias contando a partir de quando? Do dia 19? Preciso destas informaçÃµes também para o preenchimento da minha pesquisa de satisfaço no e-bit. Obrigada', 'Customer', '2020-11-09 18:16:49', '2020-11-09 18:16:49', '2017-12-13 06:55:35');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (31, 14, 'RE: COnfirmação de data de entrega', 'Olá. A data de entrega é de 3 dias úteis contando a partir do dia de confirmação do pagamento via cartão ou boleto.', 'Expert', '2020-11-09 18:16:50', '2020-11-09 18:16:50', '2017-12-13 06:55:35');
INSERT INTO public.tickets_interactions (id, ticket_id, subject, message, sender, created_at, updated_at, date_create) VALUES (32, 14, 'RE: COnfirmação de data de entrega', 'Mas já faz mais de 3 dias q o pagto já foi confirmado', 'Customer', '2020-11-09 18:16:50', '2020-11-09 18:16:50', '2017-12-13 06:55:35');
